import React, { useState } from "react";
import axios from "../../api/axiosClient";

export default function ProductRow({ product, onUpdate, onSelect }) {
  const [isEditing, setEditing] = useState(false);
  const [form, setForm] = useState({ ...product });

  const save = async () => {
    try {
      await axios.put(`/api/products/${product.id}`, form);
      setEditing(false);
      onUpdate(); // refresh table
    } catch (err) {
      console.error("Update error:", err);
      alert("Failed to update product");
    }
  };

  const deleteProduct = async () => {
    if (!window.confirm("Delete this product?")) return;

    try {
      await axios.delete(`/api/products/${product.id}`);
      onUpdate();
    } catch (err) {
      console.error("Delete error:", err);
      alert("Failed to delete product");
    }
  };

  const placeholderImage = "https://via.placeholder.com/40?text=Img";

  return (
    <tr className="border-b">
      {/* Image Column */}
      <td className="p-2">
        <img
          src={product.image || placeholderImage}
          alt={product.name}
          style={{
            width: 40,
            height: 40,
            borderRadius: 4,
            objectFit: "cover",
          }}
        />
      </td>

      {/* Name */}
      <td className="p-2">
        {isEditing ? (
          <input
            className="border p-1 rounded w-full"
            value={form.name}
            onChange={(e) => setForm({ ...form, name: e.target.value })}
          />
        ) : (
          product.name
        )}
      </td>

      {/* Unit */}
      <td className="p-2">
        {isEditing ? (
          <input
            className="border p-1 rounded w-full"
            value={form.unit}
            onChange={(e) => setForm({ ...form, unit: e.target.value })}
          />
        ) : (
          product.unit
        )}
      </td>

      {/* Category */}
      <td className="p-2">
        {isEditing ? (
          <input
            className="border p-1 rounded w-full"
            value={form.category}
            onChange={(e) => setForm({ ...form, category: e.target.value })}
          />
        ) : (
          product.category
        )}
      </td>

      {/* Brand */}
      <td className="p-2">
        {isEditing ? (
          <input
            className="border p-1 rounded w-full"
            value={form.brand}
            onChange={(e) => setForm({ ...form, brand: e.target.value })}
          />
        ) : (
          product.brand
        )}
      </td>

      {/* Stock */}
      <td className="p-2">
        {isEditing ? (
          <input
            type="number"
            className="border p-1 rounded w-full"
            value={form.stock}
            onChange={(e) =>
              setForm({ ...form, stock: Number(e.target.value) })
            }
          />
        ) : (
          product.stock
        )}
      </td>

      {/* Status */}
      <td className="p-2">
        <span
          className={
            product.stock > 0 ? "text-green-600 font-semibold" : "text-red-600 font-semibold"
          }
        >
          {product.stock > 0 ? "In Stock" : "Out of Stock"}
        </span>
      </td>

      {/* Actions */}
      <td className="p-2">
        {isEditing ? (
          <>
            <button
              onClick={save}
              className="px-2 py-1 bg-blue-600 text-white rounded mr-2"
            >
              Save
            </button>
            <button
              onClick={() => {
                setEditing(false);
                setForm({ ...product });
              }}
              className="px-2 py-1 bg-gray-400 text-white rounded"
            >
              Cancel
            </button>
          </>
        ) : (
          <>
            <button
              onClick={() => setEditing(true)}
              className="px-2 py-1 bg-blue-500 text-white rounded mr-2"
            >
              Edit
            </button>

            <button
              onClick={deleteProduct}
              className="px-2 py-1 bg-red-500 text-white rounded mr-2"
            >
              Delete
            </button>

            <button
              onClick={() => onSelect(product)}
              className="px-2 py-1 bg-gray-700 text-white rounded"
            >
              History
            </button>
          </>
        )}
      </td>
    </tr>
  );
}
